import React from 'react';

export default function  Title( props) {
    const titleName = props.titleName; 
    const index = props.index; 
    const size = null ; 

    if (props.size != null){
        size = props.size
    }
    const styles = {
        h3: {
            fontSize: size, 
        }
    }

    return (
        <h3 style={size != null ? styles.h3 : '' }> {index} <span> {titleName}</span> </h3>
    )
}
